# MAGIC %md _`trips_h3` と `trips_h3_15` にはそれぞれ16億行が含まれています。_
# MAGIC 
# MAGIC > レンダリングする際には何かしらの方法でフィルタリングしたいと考えており、スタート地点として2つの空港の移動のみを表示します！

# COMMAND ----------

# MAGIC %md
# MAGIC 空港の最小の解像度を見つけます。
# MAGIC 
# MAGIC > `min(h3_resolution(cell))` = 8 の結果を `h3_toparent` 呼び出しで使用します。

# COMMAND ----------

# MAGIC %sql
# MAGIC select
# MAGIC   min(h3_resolution(cell))
# MAGIC from
# MAGIC   airports_h3_c

# COMMAND ----------

# MAGIC %md
# MAGIC **代わりにコンパクト化されたセルを使用し、フィルターとして親IDと`h3_ischildof`エクスプレッションを使用します。**
# MAGIC 
# MAGIC > `h3_toparent(t.pickup_cell, 8) = h3_toparent(src.cell, 8)`  
# MAGIC > `and h3_toparent(t.dropoff_cell, 8) = h3_toparent(trg.cell, 8)`  
# MAGIC > `and h3_ischildof(t.pickup_cell, src.cell)`  
# MAGIC > `and h3_ischildof(t.dropoff_cell, trg.cell)`

# COMMAND ----------

# MAGIC %sql create
# MAGIC or replace view airport_trips_h3_c as (
# MAGIC   select
# MAGIC     t.passenger_count,
# MAGIC     t.fare_amount,
# MAGIC     src.locationid as src_locationid,
# MAGIC     trg.locationid as trg_locationid,
# MAGIC     src.cell as src_cell,
# MAGIC     trg.cell as trg_cell
# MAGIC   from
# MAGIC     trips_h3_15 t,
# MAGIC     airports_h3_c src,
# MAGIC     airports_h3_c trg
# MAGIC   where
# MAGIC     h3_toparent(t.pickup_cell, 8) = h3_toparent(src.cell, 8)
# MAGIC     and h3_toparent(t.dropoff_cell, 8) = h3_toparent(trg.cell, 8)
# MAGIC     and h3_ischildof(t.pickup_cell, src.cell)
# MAGIC     and h3_ischildof(t.dropoff_cell, trg.cell)
# MAGIC     and src.locationid <> trg.locationid
# MAGIC );
# MAGIC -- HOW MANY TRIPS?
# MAGIC select
# MAGIC   format_number(count(*), 0) as count
# MAGIC from
# MAGIC   airport_trips_h3_c

# COMMAND ----------

# MAGIC %md
# MAGIC 
# MAGIC > 移動データに関する一連の質問に答えるために、H3のセルIDを用いてairportとtripsテーブルを容易に組み合わせることができます。例えば、料金による収益はどれだけだったのでしょうか？

# COMMAND ----------

# MAGIC %sql
# MAGIC select
# MAGIC   format_number(count(*),0) as num_trips,
# MAGIC   format_number(sum(passenger_count),0) as num_passengers,
# MAGIC   (
# MAGIC     '$' || cast(format_number(sum(fare_amount), 2) as string)
# MAGIC   ) as earnings
# MAGIC from
# MAGIC   airport_trips_h3_c

# COMMAND ----------

# MAGIC %sql create
# MAGIC or replace view src_airport_trips_h3_c as (
# MAGIC   select
# MAGIC     src_cell as cell,
# MAGIC     src_locationid as locationid,
# MAGIC     format_number(count(*), 0) as trip_cnt_disp,
# MAGIC     format_number(sum(passenger_count), 0) as passenger_sum_disp,
# MAGIC     (
# MAGIC       '$' || cast(format_number(sum(fare_amount), 2) as string)
# MAGIC     ) as fare_sum_disp,
# MAGIC     count(*) as trip_cnt,
# MAGIC     sum(passenger_count) as passenger_sum,
# MAGIC     sum(fare_amount) as fare_sum
# MAGIC   from
# MAGIC     airport_trips_h3_c
# MAGIC   group by
# MAGIC     cell,
# MAGIC     src_locationid
# MAGIC );

# COMMAND ----------

