# MAGIC %md ### お客様がLaGuardiaで乗車した際、他に降車した場所はどこでしょうか？
# MAGIC 
# MAGIC > LGAから出発したデータでは2500万の降車記録があります！

# COMMAND ----------

# MAGIC %sql create
# MAGIC or replace temp view lga_dropoffs as (
# MAGIC   select
# MAGIC     pickup_cell,
# MAGIC     dropoff_cell,
# MAGIC     passenger_count,
# MAGIC     fare_amount,
# MAGIC     air.locationid as pickup_locationid
# MAGIC   from
# MAGIC     trips_h3
# MAGIC     INNER JOIN (
# MAGIC       select
# MAGIC         *
# MAGIC       from
# MAGIC         airports_h3
# MAGIC       where
# MAGIC         locationid = 132
# MAGIC     ) air ON trips_h3.pickup_cell = air.cell
# MAGIC );
# MAGIC -- HOW MANY TOTAL DROP-OFFS from LGA?
# MAGIC select
# MAGIC   format_number(count(*), 0) as count
# MAGIC from
# MAGIC   lga_dropoffs;

# COMMAND ----------

# MAGIC %md __降車したH3セルのいちごとにカウントを集計しましょう。__
# MAGIC 
# MAGIC > LGAからの2500万の降車記録から838Kの固有のH3の位置を取得しました。

# COMMAND ----------

# MAGIC %sql create
# MAGIC or replace temp view lga_agg_dropoffs as (
# MAGIC   select
# MAGIC     count(*) as dropoff_cnt,
# MAGIC     dropoff_cell
# MAGIC   from
# MAGIC     lga_dropoffs
# MAGIC   group by
# MAGIC     dropoff_cell
# MAGIC );
# MAGIC select
# MAGIC   format_number(count(*), 0) as count
# MAGIC from
# MAGIC   lga_agg_dropoffs;

# COMMAND ----------

